def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """

    priorities = []
    max_capacity = max(bins)
    min_capacity = min(bins)
    bin_count = len(bins)
    sum_bins = sum(bins)
    avg_bin_capacity = sum_bins / bin_count

    for i in range(bin_count):
        remaining_capacity = bins[i] - item
        future_capacity = max_capacity - item
        past_capacity = min_capacity - item

        if remaining_capacity >= 0:
            if bins[i] == max_capacity:
                priority = 1.8 / (1 + remaining_capacity) if remaining_capacity >= item else 1.1 / (1 + remaining_capacity)
            elif bins[i] == min_capacity:
                priority = 0.9 / (1 + remaining_capacity)
            else:
                priority = 1.3 / (1 + remaining_capacity)
        else:
            if future_capacity >= 0:
                priority = 1.2 / (1 + future_capacity) if future_capacity > remaining_capacity else 0.6 / (1 + future_capacity)
            else:
                priority = 0.9 / (1 + past_capacity) if past_capacity > remaining_capacity else 0.7 / (1 + past_capacity)

        # Additional complex logic based on average bin capacity
        if bins[i] > avg_bin_capacity:
            priority *= 1.2
        elif bins[i] < avg_bin_capacity:
            priority *= 0.8

        priorities.append(priority)

    return np.array(priorities)
